  document.getElementById("Main").appendChild(<Test></Test>);
};

document.getElementById("Main").appendChild(<Test></Test>);

axios.post("http://localhost:3001/api/GetItems").then((response) => {
  console.log(response.data);
  response.data.map((item) => {
    console.log(item);
    CreateItem(item);
  });
});
